import React from "react";
import Filters from "./MainFilter/filters";

const Main = () => {
  return (
    <>
      <div className="container">
        <div className="row">
          <Filters />
        </div>
        <div className="row">
          <div className="col-7">Images</div>
          <div className="col-5">Grid</div>
        </div>
      </div>
    </>
  );
};

export default Main;
